function LanguageItem({ logo,name,linkGithub,linkCertif }) {
    return (
      <div className="language-item">
        <img src={logo} alt={name} className="logo" />
        <h4>{name}</h4>
        <p>Les projets <a href= {linkGithub}>Github</a></p>
        <p>La certification<a href= {linkCertif}>OpenclassRooms</a></p>
      </div>
    );
  }
    
